We had a great day all in all. But we came into a serious mess this morning.  Last nights storm brought down trees everywhere.  We had multiple paddleboards break loose, canoes and pedal boats filled to the  max, several dock parts snapped and broke and branches and leaves covered everything. 

Sunny side, were all fixed and cleaned up and ready for a great holiday weekend thanks to my awesome staff and even one of their dads.

Were open 10am-5pm through Labor Day Monday this weekend.  Ages 3 and up. $15.00 single kayaks, $20.00 everything else (per vessel,per hour). No reservations. 

